CodeMirror.braceRangeFinder=function(l,a){var q=a.line,j=l.getLine(q);var b=j.length,r,n;for(;b>0;){var p=j.lastIndexOf("{",b);if(p<a.ch){break}n=l.getTokenAt(CodeMirror.Pos(q,p+1)).type;if(!/^(comment|string)/.test(n)){r=p;break}b=p-1}if(r==null||j.lastIndexOf("}")>r){return}var g=1,k=l.lineCount(),c,e;outer:for(var d=q+1;d<k;++d){var o=l.getLine(d),h=0;for(;;){var f=o.indexOf("{",h),m=o.indexOf("}",h);if(f<0){f=o.length}if(m<0){m=o.length}h=Math.min(f,m);if(h==o.length){break}if(l.getTokenAt(CodeMirror.Pos(d,h+1)).type==n){if(h==f){++g}else{if(!--g){c=d;e=h;break outer}}}++h}}if(c==null||c==q+1){return}return{from:CodeMirror.Pos(q,r+1),to:CodeMirror.Pos(c,e)}};